import logoUmpa from "../../assets/images/logo-umpa-loompa.png";
import { Link } from "react-router-dom";
import "./NavBar.css";

const NavBar = () => {
  return (

      <navbar className="navbar">

          <Link to="/">
            <img
              alt="logo umpa loompa"
              src={logoUmpa}
              width="30"
              height="30"
              className="d-inline-block align-top"
            />
            Oompa Loompa's Crew
          </Link>

      </navbar>

  );
};

export default NavBar;
